import { GiHamburgerMenu } from "react-icons/gi";

export const Sidebar = () => {
    const {isopen, setISopen} = useState(false);

  return (
    <div className='navbar'>
        <div className='meun-icon' onClick={() => setISopen(!isopen)}>
        <GiHamburgerMenu />
        </div>
    </div>
  )
}
